import React from 'react';

const Title = (props) => {
    return (
        <div class="container" style={{fontSize:'20px', left:'50%',top:'50%'}}>
    <div className="row title"><strong >{props.name}</strong></div>
    <div className="row title"><strong >{props.title}</strong></div>
        </div>
    );
};

export default Title;
